#include <vector>
#include <iostream>
#include <stack>
#include <algorithm>
#include <list>

using namespace std;


class Solution {
public:
    struct Bar {
        int start;
        int end;
        int height;
        int area;
    };

    int addBars(list<Bar>& bars, int index, int height) {
        auto new_bar = Bar{index, index, height, height};

        if (bars.empty()) {
            bars.push_back(new_bar);
            return new_bar.area;
        }

        int max_area = 0;
        int new_start_index = index;
        while (!bars.empty() && bars.back().height >= height) {
            new_start_index = bars.back().start;
            bars.pop_back();
        }
        new_bar.area = (new_bar.end - new_start_index + 1) * new_bar.height;
        new_bar.start = new_start_index;
        max_area = std::max(max_area, new_bar.area);

        for (auto& bar: bars) {
            bar.area = (index - bar.start + 1) * bar.height;
            bar.end = index;
            max_area = std::max(max_area, bar.area);
        } 

        bars.push_back(new_bar);

        return max_area;
    }

    int largestRectangleArea(vector<int>& h) {
        list<Bar> bars;

        int max_area = 0;
        for (int i = 0; i < h.size(); ++i) {
            max_area = std::max(max_area, addBars(bars, i, h[i]));
        }

        return max_area;
    }
};


